    public static Dictionary<char, Color> SpectrumColor = new Dictionary<char, Color>()
    {
        {'O', new Color(0.5f,0.7f,1,1)},
        {'B', new Color(0.5f,1,1,1)},
        {'A', new Color(1,1,1,1)},
        {'F', new Color(1,1,0.6f,1)},
        {'G', new Color(1,1,0,1)},
        {'K', new Color(1,0.7f,0,1)},
        {'M', new Color(1,0.5f,0.5f,1)},
    };

    public class Info
    {
        public float RADegree; // 赤経
        public float DDegree; // 赤緯
        public float Magnitude;
        public char Spectrum;

        private const float Radius = 100.0f;

        public Info(float raDegree, float dDegree,
            float magnitude, char spectrum)
        {
            RADegree = raDegree;
            DDegree = dDegree;
            Magnitude = magnitude;
            Spectrum = spectrum;
        }

        public Vector3 CalcPosition()
        {
            Quaternion quat = Quaternion.Euler(-DDegree, -RADegree, 0.0f);
            var v = quat * (Vector3.forward * Radius);

            return v;
        }

        public Color Color
        {
            get
            {
                return SpectrumColor.ContainsKey(Spectrum) ? SpectrumColor[Spectrum] : Color.white;
            }
        }
    }

